if days == 0:
        return pd.DataFrame()

    np.random.seed(random_seed)
    date_range = pd.date_range('2023-01-01', periods=days)

    # Calculate total spending for each day
    total_spending = pd.DataFrame(
        index=date_range,
        columns=('Groceries', 'Entertainment', 'Rent', 'Utilities', 'Miscellaneous'),
    )

    for day in date_range:
        spending = dict()
        for col_name, weight in (('Groceries', .33), ('Entertainment', .33), ('Rent', .2), ('Utilities', .1), ('Miscellaneous', .1)):
            spending[col_name] = np.random.randint(low=0, high=101) * weight
        total_spending.loc[day] = spending

    return total_spending
